            <tr>
              <td className="sq" onClick={this.PrintEle("row: 2\tcol: 1")}></td>
              <td className="sq" onClick={this.PrintEle("row: 2\tcol: 2")}></td>
            </tr>
          </tbody>
        </table>
      </div>
    );
  }
